import {BrowserRouter, Route, Routes} from "react-router-dom";
import Home from "./pages/Home";
import Employees from "./pages/Employees";

function App() {
  return (
    <BrowserRouter>
        <Routes>
            <Route path='/' Component={Home}></Route>
            <Route path='/employee' Component={Employees}></Route>
        </Routes>
    </BrowserRouter>
  );
}

export default App;
